import React from 'react'

const Page1Main = () => {
    return (
        <div className="w-full p-2">
            <div className="w-full flex items-center justify-center text-3xl text-slate-600 mt-10 mb-2">
                Budget your Spend
                <h6 className="w-full  flex items-center justify-center mt-6 text-sm">CostFinder helps you figure out your average spend based on the elements you like in your space
                </h6>
            </div>
        </div>
    )
}

export default Page1Main
